    state = {} as State;

    constructor(props: Props) {
        super(props);

        
    }
    onClickGetThereButton(event: React.MouseEvent<HTMLButtonElement>){
        window.open(
            config().busmapper.frontendBaseUrl + "/#/EiZBbGRyaWNoIEJheSBSZCwgQWxkcmljaCBCYXksIEhvbmcgS29uZyIuKiwKFAoSCd8sWCl4AQQ0EU_PTF0tbPvlEhQKEglLSK9JdwEENBGAraT03BRFHQ"
            , '_blank'
        )!.focus();
    }
    render(){
        return (
            <section className="contactUsContainer">
                <Container>
                    <Row>
                        <Col md={6}>
                        {/* <a href="https://www.google.com/maps/place/oi+yin+street,+aldrich+bay+road/"/>
                            <img className="map" src="https://maps.googleapis.com/maps/api/staticmap?center=oi+yin+street,+aldrich+bay+road&zoom=16&scale=1&size=600x300&maptype=roadmap&key=AIzaSyCjCVCEaRCewdaqDQE6ocCPC1x_W-EsS-g&format=png&visual_refresh=true&markers=size:mid%7Ccolor:0xff0000%7Clabel:%7Coi+yin+street,+aldrich+bay+road" alt="Google Map of oi yin street, aldrich bay road"/> */}
                            <iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3691.9576007882424!2d114.22593961486216!3d22.27959588533427!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3404017830f024bf%3A0x62f77245bde3831!2z5oSb56ep5bqP54Gj5oSb56ep5bqP54Gj6YGTICYg5oSb6LOi6KGX!5e0!3m2!1szh-TW!2shk!4v1617937428015!5m2!1szh-TW!2shk" width="100%" height="400" style={{border:0}} loading="lazy"></iframe>
                        </Col>
                        <Col md={6}>
                            <h2>Contact Us</h2>
                            Phone: 91234567
                            {/* Address: xxx,Shau Kei Wan */}
                            <Button 
                                variant='primary'
                                onClick={this.onClickGetThereButton}>How to get there</Button>
                        </Col>
                    </Row>
                </Container>
            </section>
        )
    }
}
